import React from "react";
import Header from "./header";
import Footer from "./footer";
import Note from "./note";
import Keep from "./keep";


function App() {
    return ( <
        div >
        <
        Header / >
        <
        Note title = { Keep.title }
        content = { Keep.content }
        / > <
        Footer / >
        <
        /div>
    );
}

export default App;
